function getPageContentByHash(t=window.location.hash){if(t!==lastPage){switch(t){case"#legal-notice":case"#privacy":let e=t.slice(1);setPageContent(`pages/${e}.html`);break;default:"#start"!==window.location.hash&&(window.location.hash="#start"),setPageContent("pages/start.html")}lastPage=t}}function setPageContent(t){fetch(t).then(function(t){return t.text()}).then(function(t){document.getElementsByTagName("main")[0].innerHTML=t})}let lastPage;